import React from "react";
import styled from "styled-components";

const SideBar = () => {
  const SideContainer = styled.div`
    display: flex;
    flex: 1.2;
    // background-color: red;
    padding: 20px;
  `;
  const Logo = styled.div`
    width: 100%;
    // height: 100%;
  `;
  const LogoImg = styled.img`
    width: 100px;
  `;
  const SideList = styled.ul``;
  const SideItems = styled.li`
    list-style-type: none;
    margin-bottom: 20px;
    padding: 10px;
    background-color: red;
    border-radius: 10px;
  `;
  const UserName = styled.div``;
  const List = styled.span``;
  const ListNotify = styled.div``;

  return (
    <SideContainer>
      <Logo>
        <LogoImg src="/images/logo2.png"></LogoImg>
      </Logo>
      <SideList>
        <SideItems>
          <List>Messages</List>
          <ListNotify></ListNotify>
        </SideItems>
        <SideItems>
          <List>My Posts</List>
          <ListNotify></ListNotify>
        </SideItems>
        <SideItems>
          <List>Liked Profiles</List>
          <ListNotify></ListNotify>
        </SideItems>
        <SideItems>
          <List>Shortlisted Profiles</List>
          <ListNotify></ListNotify>
        </SideItems>
        <SideItems>
          <List>Rejected Profiles</List>
          <ListNotify></ListNotify>
        </SideItems>
        <SideItems>
          <List>My Profile</List>
          <ListNotify></ListNotify>
        </SideItems>
        <SideItems>
          <List>Settings</List>
          <ListNotify></ListNotify>
        </SideItems>
      </SideList>
      <UserName></UserName>
    </SideContainer>
  );
};

export default SideBar;
